svg.script:


var windDir = (getQueryString()["dir"]==undefined || getQueryString()["dir"]=="") ? 0.0 : getQueryString()["dir"];
var windSpd = (getQueryString()["spd"]==undefined || getQueryString()["spd"]=="") ? 10.0 : getQueryString()["spd"];

function getQueryString() {
  var result = {}, queryString = location.search.substring(1),
      re = /([^&=]+)=([^&]*)/g, m;

  while (m = re.exec(queryString)) {
    result[decodeURIComponent(m[1])] = decodeURIComponent(m[2]);
  }

  return result;
}

function toggleInfo()
{
     if(document.getElementById("info").getAttribute("visibility") == "hidden")
     {
      document.getElementById("info").setAttribute("visibility","visible");
     }else
     { document.getElementById("info").setAttribute("visibility","hidden");
     }
}
